Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.api.java.function.VoidFunction;
import scala.Tuple2;

import java.util.HashMap;
import java.util.Map;

public class OnsiteHitRate {

    public static void main(String[] args) {
        // Initialize Spark context
        JavaSparkContext sc = new JavaSparkContext(new SparkConf().setAppName("OnsiteHitRate"));

        // Load onsite attributed data
        JavaRDD<String> onsiteData = sc.textFile("onsite_data.txt");

        // Load top frequent queries
        JavaRDD<String> topQueries = sc.textFile("top_queries.txt");

        // Convert top queries to a map for quick lookup
        final Map<String, Long> topQueriesMap = new HashMap<>();
        topQueries.foreach(new VoidFunction<String>() {
            @Override
            public void call(String query) throws Exception {
                topQueriesMap.put(query, System.currentTimeMillis());
            }
        });

        // Calculate hit rate
        final Map<String, Integer> hitRateMap = new HashMap<>();
        onsiteData.foreach(new VoidFunction<String>() {
            @Override
            public void call(String record) throws Exception {
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);

                if (topQueriesMap.containsKey(query)) {
                    long cacheTime = topQueriesMap.get(query);
                    if (timestamp - cacheTime > 12 * 60 * 60 * 1000) { // 12 hours in milliseconds
                        hitRateMap.put(query, hitRateMap.getOrDefault(query, 0) + 1);
                        topQueriesMap.put(query, timestamp);
                    }
                }
            }
        });

        // Calculate overall hit rate
        int totalQueries = onsiteData.count();
        int totalHits = hitRateMap.values().stream().mapToInt(Integer::intValue).sum();
        double hitRate = (double) totalHits / totalQueries;

        System.out.println("Overall hit rate: " + hitRate);

        // Save hit rate per query
        JavaPairRDD<String, Integer> hitRateRDD = sc.parallelizePairs(hitRateMap.entrySet()).mapToPair(new PairFunction<Map.Entry<String, Integer>, String, Integer>() {
            @Override
            public Tuple2<String, Integer> call(Map.Entry<String, Integer> entry) throws Exception {
                return new Tuple2<>(entry.getKey(), entry.getValue());
            }
        });
        hitRateRDD.saveAsTextFile("hit_rate_per_query.txt");

        // Stop Spark context
        sc.stop();
    }
}
```

This job calculates the hit rate for onsite attributed data by iterating through each record and checking if the query is present in the top frequent queries dataset. If the query is present and it's the first time the system encounters it, it increments the hit count for that query and updates the cache time. The overall hit rate is calculated by dividing the total number of hits by the total number of queries. The hit rate per query is saved as a text file.

