Here's an example of how you might write the `onSubmit` function for a form using React and Apollo Client for GraphQL:
```javascript
import React from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations'; // Import your mutation

function MyForm() {
  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData(event.target);
    const variables = Object.fromEntries(formData);

    try {
      const response = await addData({ variables });
      console.log('Data added:', response.data);
    } catch (err) {
      console.error('Error adding data:', err);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      {/* Your form fields go here */}
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
```
In this example, `useMutation` is a hook provided by Apollo Client that allows you to execute a mutation and handle the response. The `ADD_DATA` mutation is imported from a separate file, which should contain the GraphQL query for adding data.

The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, extracts the form data into an object, and then calls the `addData` function with the form data as variables. The response from the mutation is logged to the console. If there is an error, it is caught and logged to the console as well.

