Creating a Chrome extension involves several steps and requires knowledge of HTML, CSS, and JavaScript. Here's a basic outline of how you can create a Chrome extension that takes screenshots of webpages:

1. Create a new directory on your computer to store the extension files.

2. Inside the new directory, create a file named `manifest.json`. This file will contain metadata about your extension, such as its name, version, and permissions. Here's an example of what the `manifest.json` file might look like:
```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Take screenshots of webpages",
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "tabs",
    "<all_urls>"
  ]
}
```
3. Create an icon for your extension and save it as `icon.png` in the same directory as the `manifest.json` file.

4. Create a new file named `popup.html` in the same directory as the `manifest.json` file. This file will contain the HTML code for the extension's popup window. Here's an example of what the `popup.html` file might look like:
```html
<!DOCTYPE html>
<html>
  <head>
    <style>
      body {
        width: 300px;
        height: 200px;
      }
      button {
        width: 100%;
        height: 50px;
        font-size: 20px;
      }
    </style>
  </head>
  <body>
    <button id="screenshot-button">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>
```
5. Create a new file named `popup.js` in the same directory as the `manifest.json` file. This file will contain the JavaScript code for the extension's popup window. Here's an example of what the `popup.js` file might look like:
```javascript
document.getElementById('screenshot-button').addEventListener('click', function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(img) {
      var screenshotUrl = img;
      var viewTabUrl = tabs[0].url;
      chrome.tabs.create({url: screenshotUrl, active: true});
    });
  });
});
```
6. Load the extension into Chrome by navigating to `chrome://extensions/` in the browser, enabling "Developer mode" in the top right corner, clicking "Load unpacked", and selecting the directory containing the extension files.

7. Test the extension by clicking on its icon in the Chrome toolbar and clicking the "Take Screenshot" button in the popup window. The extension should take a screenshot of the current webpage and open it in a new tab.

