Here are the JavaScript functions to pack and unpack an array of entities to an ArrayBuffer:

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length * 1); // 1 byte per entity
  const view = new DataView(buffer);

  entities.forEach((entity, index) => {
    const byte = (entity.id << 3) | (entity.size & 0x07);
    view.setUint8(index, byte);
  });

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  for (let i = 0; i < view.byteLength; i++) {
    const byte = view.getUint8(i);
    const id = (byte >> 3) & 0x0F;
    const size = byte & 0x07;
    entities.push({ id, size });
  }

  return entities;
}
```

These functions assume that the `entities` array is an array of objects with `id` and `size` properties. The `packEntities` function creates an ArrayBuffer with a size of 1 byte per entity and then iterates through the entities, packing the `id` and `size` into a single byte using bitwise operations. The `unpackEntities` function does the reverse, iterating through the ArrayBuffer and extracting the `id` and `size` from each byte using bitwise operations.

